import React, { Component} from 'react';
import  InputRange  from './InputSlider';

class noValueSlider extends Component {
    constructor(props) {
        super(props);

        this.state = {
            rangeVal: 0,
            value: 5,
            value2: 10,
            value3: 10,
            value4: {
                min: 5,
                max: 10,
            },
            value5: {
                min: 3,
                max: 7,
            },
        };
    }
    render() {
        const { rangeval } = this.state;
        return (
            <form className="form">                
                <InputRange maxValue={20}
                    minValue={0}
                      rangeval={rangeval}   value={this.state.value} onChange={(e) => this.setState({value: e.value})} />
            </form>
        );
    }
}


export default noValueSlider;
